    "2013-03-19T00:28:45.528842",nt"name": "engineering-geologic-map-alaska-highway-corridor-delta-junction-to-dot-lake-alaska",nt"isopen":
    false,nt"url": null,nt"notes": "The engineering-geologic map, on two sheets,
    is derived electronically from the surficial-geologic map of the initial segment
    of the proposed natural gas pipeline corridor through the upper Tanana valley (Reger
    and others, PIR 2008-3a) using Geographic Information System (GIS) software. Surficial-geologic
    units were initially identified by interpretation of false-color ~1:63,000-scale
    infrared aerial photographs taken in July 1978, August 1980, and August 1981 and
    locally verified by field checking in 2006 and 2007. The map shows the distribution
    of surficial-geologic and bedrock units grouped genetically with common properties
    that are typically significant for engineering applications.",nt"license_title":
